import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookSquare, faInstagram, faTikTokfaWhatsApp } from '@fortawesome/free-solid-svg-icons';

const Footer = () => {
  return (
    <footer>
      <p>DENTAL CLINIC</p>
      <div>
      <FontAwesomeIcon icon={faWhatsApp} style={{color: "#eff1f5",}} />
        <FontAwesomeIcon icon={faFacebookSquare} style={{color: "#000fff",}} />
        <FontAwesomeIcon icon={faInstagram} style={{color: "#000fff",}} />
        <FontAwesomeIcon icon={faTikTok} style={{color: "#e5e9f1",}} />
      </div>
    </footer>
  )
}

export default Footer
